import axios from "axios";
import { Button, DataTable } from "bold-ui";
import React, { useState } from "react";

export default function App() {
  //var oi = "";
  const [state, setState] = useState({
    projetos: {}
  });

  let projetos = projs => {
    return projs;
  };

  axios.get("/kkk").then(resp => {
    // console.log(resp.data);
    //setState(resp.data.n);
    //setState({ projetos: resp.data.projetos });
    //console.log(state);
    projetos(resp.data.projetos);
    state.map(item => console.log(item.name));
  });

  console.log(projetos());
  return (
    <>
      <Button>Hello</Button>
      <DataTable
        rows={projetos}
        columns={[{ name: "equipe", render: item => item.name }]}
      />
    </>
  );
}
